  }

  async del(key) {
    try {
      await this.delAsync(key);
      console.log(`Key ${key} deleted`);
    } catch (err) {
      console.log(`Error deleting key ${key}: ${err.message}`);
    }
  }
}

const redisClient = new RedisClient();
module.exports = redisClient;

